$(function(){

  // parallax
  $('.scene').each(function(){
    const modifier = $(this).data('modifier')
    basicScroll.create({
      elem: this,
      from: 0,
      to: 519,
      direct: true,
      props: {
        '--translateY': {
          from: '0',
          to: `${ 1 * modifier }px`
        }
      }
    }).start()
  });

  // mana day
  var realDate = new Date();
  var realDays = ['Sun', 'Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat'];
  var manaDays = ['Mana Holy', 'Aura', 'Salamander', 'Undine', 'Dryad', 'Jinn', 'Gnome'];
  var realDay = realDays[realDate.getDay()];
  var manaDay = manaDays[realDate.getDay()];
  $('#head-day img').attr({'src': '/_assets/img/dotw/'+ realDay +'.png', 'alt': manaDay});
  $('#head-day b span').text(manaDay);

  // modal
  $('.lb').on('click', function(e){
    e.preventDefault();
    $(this).modal({
      fadeDuration: 250,
      fadeDelay: .25
    });
  });

});